swaptrade_modal_desc_crosschain_valuedif:
Fees factored into the value difference of this bridge transaction are:
• Cross-chain bridge fee: {bridgePriceAndFee}
• Network fee on the destination network: {toChainPriceAndFee}

When you trade a certain amount of tokens, it affects the liquidity pool’s depth. This, in turn, changes the overall availability and price of the tokens, leading to noticeable differences in prices.

swaptrade_servicefee_tab_desc_fees_are_c:
Fees are collected based on the token types within a token pair. In a token A-to-token B swap transaction, OKX determines the fee rate by checking the token types in the following order:

1. Most stablecoins;
2. Most native/wrapped native tokens;
3. If there are no tokens in the first 2 categories in the token pair, OKX will collect the fee using the token with higher liquidity at the time of the transaction.
4. The fees and the tokens charged will be reflected in the users’ transaction history.

