swaptrade_mid_dialog_desc_est_network_fe:
In bridge transactions, this fee includes the network fees for both the source network and the cross-chain bridge.

The fee for this transaction is made up of:
· {chain} network fee: {value1}
· {bridge} bridge network fee: {value2}

We don’t charge network fees as they are payments to miners.

swaptrade_intro_dialog_desc_cross_value_:
The value difference of this transaction is shown as:
· {chain} network fee: {value1}
· {bridge} bridge fee: {value2}

If the value difference is much bigger while the fees listed above are relatively small, it’s because the bridge amount has affected the depth of this token pair’s liquidity pool.

swaptrade_intro_tooltip_trade_including_:
In bridge transactions, the cost includes the network fee of the payment network and a portion of the cross-chain bridge fee. Fee breakdown of this transaction:
• Network fee: {fromChainPriceAndFee}
• Cross-chain bridge fee: {bridgePriceAndFee}
The network fee covers miner costs and isn’t charged by our platform.

